import React, { Component } from 'react'
import loading from './panda-loader.gif'

export default class Spinner extends Component {

    render() {
        return(
        <div className='text-center'>
            <img src={loading} alt="loading" height={'20px'} width={'20px'}></img>
        </div>
    )}
}
